import styled from "styled-components";
import Text from "./ui-components/text";
import {Button, Col, Form, Row, Table} from "react-bootstrap";
import 'bootstrap/dist/css/bootstrap.min.css';
import {useState} from "react";
import {
    SortByEmail,
    SortById,
    SortByLastName,
    SortByLink,
    SortByName,
    SortByPayStatus,
    SortByUsername
} from "./helpers/sort";
import {backendData, data} from "./helpers/data";

const Wrapper = styled.div`
  min-height: 100vh;
  padding: 0 15px;
  display: flex;
  flex-direction: column;
`;

const ModifiedTh = styled.th`
  cursor: pointer;
`;

function App() {
    let data = backendData
    data = backendData.map((item, index) => {
        item.id = JSON.stringify(item.id)
        item.didPay = item.pay_status ? "Оплатил" : "Не оплатил"
    })

    console.log("Data", data)

    const [state, setState] = useState(data)

    const [count, setCount] = useState({
        sortById: 0,
        sortByName: 0,
        sortByLastName: 0,
        sortByUsername: 0,
        sortByEmail: 0,
        sortByPayStatus: 0,
        sortByLink: 0
    });

    const RemoveItem = (id) => {
        setState(state.filter(item => item.id !== id))
    }

    const [validated, setValidated] = useState(false);
    const [search, setSearch] = useState("")

    const changeValueOfSearch = (e) => {
        setSearch(e.target.value)
        setState(data)
    }

    const handleSubmit = (event) => {
        const form = event.currentTarget;
        event.preventDefault();
        if (form.checkValidity() === false) {
            event.stopPropagation();
        }
        setValidated(true);
        setState(state.filter(item => Object.values(item).indexOf(search) !== -1))
    };


    return (
        <Wrapper>
            <div style={{margin: "200px auto", textAlign: "center"}}>
                <Text color={"black"} fontSize={"44px"} fontWeight={600}>
                    Users
                </Text>
                <div style={{marginTop: "20px"}}>
                    {state.length !== 0
                        ? <Table striped bordered hover>
                            <thead>
                            <tr>
                                <ModifiedTh onClick={() => SortById(state, setState, count, setCount)}>Id</ModifiedTh>
                                <ModifiedTh onClick={() => SortByName(state, setState, count, setCount)}>First
                                    Name</ModifiedTh>
                                <ModifiedTh onClick={() => SortByLastName(state, setState, count, setCount)}>Last
                                    Name</ModifiedTh>
                                <ModifiedTh
                                    onClick={() => SortByUsername(state, setState, count, setCount)}>Username</ModifiedTh>
                                <ModifiedTh
                                    onClick={() => SortByEmail(state, setState, count, setCount)}>Email</ModifiedTh>
                                <ModifiedTh onClick={() => SortByPayStatus(state, setState, count, setCount)}>Pay
                                    status</ModifiedTh>
                                <ModifiedTh
                                    onClick={() => SortByLink(state, setState, count, setCount)}>Link</ModifiedTh>
                            </tr>
                            </thead>
                            <tbody>
                            {state.map((item, index) => (
                                <tr key={index}>
                                    <td>{item.id ? item.id : "-"}</td>
                                    <td>{item.first_name ? item.first_name : "-"}</td>
                                    <td>{item.last_name ? item.last_name : "-"}</td>
                                    <td>{item.username ? item.username : "-"}</td>
                                    <td>{item.email ? item.email : "-"}</td>
                                    <td>{item.pay_status ? "Оплатил" : "Не оплатил"}</td>
                                    <td>
                                        <a href={item.profile_link}>
                                            {item.profile_link && "Тык"}
                                        </a>
                                    </td>
                                    <ModifiedTh onClick={() => RemoveItem(item.id)}>
                                        <div>
                                            Удалить
                                        </div>
                                    </ModifiedTh>
                                </tr>
                            ))}
                            </tbody>
                        </Table>
                        : "Данных нет, увы("}
                    <Form noValidate validated={validated} onSubmit={handleSubmit}>
                        <Row className="mb-3">
                            <Form.Group as={Col} md="12" controlId="validationCustom01">
                                <Form.Control
                                    required
                                    type="text"
                                    placeholder="Search..."
                                    value={search}
                                    onChange={(e) => changeValueOfSearch(e)}
                                />
                                <Form.Control.Feedback type="invalid">
                                    Введите какое-нибудь значение
                                </Form.Control.Feedback>
                            </Form.Group>
                        </Row>
                        <Button type="submit">Search</Button>
                    </Form>
                </div>
            </div>
        </Wrapper>
    );
}

export default App;
